import React from 'react';

class Landing extends React.Component {
    render() {
        return (
            <div>
                <div className="colorheader">
                    <h1>Friends</h1>
                </div>
                {getFriends().slice().map(
                    friend =>
                    <Friend 
                        name={friend.name}
                        pointCount={friend.pointCount}
                    />
                )}
            </div>
        );
    }
}

function getFriends() {
    //TODO: RETURN AN ARRAY OF FRIEND OBJECTS
    //each object should contain a name, which corresponds to a string, and a pointCount, which corresponds to an int
    //{ name: "Bob", pointCount: 15 }
    return [{ name: "Bob", pointCount: 15 }, { name: "Derek", pointCount: 15 }];
}

function Friend(props) {
    return (
        <div>
            <h2>{props.name}</h2>
            <h3>Has {props.pointCount} points</h3>
        </div>
    );
}

export default Landing;
